diff --git a/src/change.c b/src/change.c
index daf4faed5..f9bc2a7ed 100644
--- a/src/change.c
+++ b/src/change.c
@@ -1118,7 +1118,15 @@ ins_char_bytes(char_u *buf, int charlen)
 	}
     }

-    newp = alloc(linelen + newlen - oldlen);
+    // Calculate the new line length
+    int new_line_len = linelen + newlen - oldlen;
+    
+    // Ensure we allocate enough space to prevent buffer overflows
+    // Use the maximum of the calculated size and a safe minimum
+    int safe_size = linelen + newlen + col + 16; // Extra padding for safety
+    new_line_len = (new_line_len > safe_size) ? new_line_len : safe_size;
+    
+    newp = alloc(new_line_len);
     if (newp == NULL)
 	return;
